import React from 'react';
import LccLinkTile from './LccLinkTile';
import { useParams, useNavigate } from 'react-router-dom';

export default function FormList() {
  return (
    <FormListComponent params={useParams()} navigate={useNavigate()} />
  );
}

class FormListComponent extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      pageNumber: this.props.params.pageNumber,
      formName: this.props.params.formName,
    };

    this.handleSubmit = this.handleSubmit.bind(this);
    this.handleBackButton = this.handleBackButton.bind(this);
  }
  
  render() {
    let forms = null;

    switch (this.state.category) {
      case "ContactUs":
        forms = [
          new FormLinkData("/ContactUs/Description", "Contact Us Pathways")
        ];
        break;

      default:
        <p>test</p>;
        break;
    }

    return (
      <>
        <div class="text">
          <h1>On-line Services</h1>
        </div>

        <div class="groupPromo">
          <div class="listWebpart">
            <ul>
              {
                forms.map((element) => {
                  return (
                    <li>
                      <LccLinkTile to={element.to} header={element.header} description={element.description} />
                    </li>
                  );
                })
              }

            </ul>
          </div>
        </div>
      </>
    );
  }
}

class FormLinkData {
  constructor(to, category, header, description) {
    this.to = to;
    this.category = category;
    this.header = header;
    this.description = description;
  }
}
